/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var maximumScore = function(nums, k) {
    const MOD = 1e9 + 7;
    let maxScore = 1;

    const getPrimeFactors = (n) => {
        const factors = new Set();
        for (let i = 2; i * i <= n; i++) {
            while (n % i === 0) {
                factors.add(i);
                n = n / i;
            }
        }
        if (n > 1) factors.add(n);
        return factors.size;
    };

    const scores = nums.map(n => ({
        value: n,
        primeScore: getPrimeFactors(n)
    })).sort((a, b) => b.primeScore - a.primeScore || b.value - a.value);

    for (let i = 0; i < k; i++) {
        maxScore = BigInt(maxScore) * BigInt(scores[i].value) % BigInt(MOD);
    }

    return Number(maxScore);
};
